  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <body className="home_hero_body">
        <main class="">
          <section class="home_hero_section">
            <div class="home_hero_container home_hero_row">

              <video>

              </video>
              <h1 class="home_hero_title">
                Square <accent id="home_hero_accent">Gallery</accent>

                 </h1>
              <div class="home_wrap_bottom">
                <p class="home_hero_text">
                  The largest community of arts enthusiasts.
                </p>



                <div>
                  <Link to="/register" class="home_hero_link  home_hero_link_button">
                    Join Today
                  </Link>
                </div>
              </div>
            </div>
          </section>
        </main>
      </body>
    );
  }
}

export default HeroSectionHome;
